import React from 'react';
import styles from './Header.module.scss';
const Header = () => {
  return (
    <header>
      <div>
        <span className={styles.logo}>Домашняя страница</span>
      </div>
      <div className={styles.presentation}></div>
    </header>
  );
};

export default Header;
